import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './Components/Navbar';
import CommentsList from './Components/CommentsList';
import Profile from './Components/Profile'; // Assuming you have a Profile page component
// Import other page components as needed
import "./App.css";
import { Auth } from "./Components/Auth";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Auth />
        <Switch>
          <Route path="/comments">
            <CommentsList />
          </Route>
          <Route path="/profile">
            <Profile />
          </Route>
          {/* Add other routes for your pages here */}
          <Route path="/">
            {/* Home page content or component */}
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
